import React from 'react';
import {Tabs} from '../../ui/components/Tabs';
import {Code} from '../components/Code';
import {Input} from '../../ui/components/Input';

export const InputsPage = () => {
    return (
        <div>
            <h1 className="content__hdr">Inputs</h1>

            <div className="box">
                <div className="box__item">
                    <Tabs>
                        <div title="View">
                            <Input 
                                type="text"
                                label={'Name input'}
                            />
                        </div>
                        <div title="Code">
                            <Code>
                                {`<Input 
    type="text"
    label={'Name input'}
/>`}
                            </Code>
                        </div>
                    </Tabs>
                </div>
                <div className="box__item">
                <Tabs>
                        <div title="View">
                            <Input 
                                type="text"
                                label={'Name input'}
                                value={'User name'}
                            />
                        </div>
                        <div title="Code">
                            <Code>
                                {`<Input 
    type="text"
    label={'Name input'}
    value={'User name'}
/>`}
                            </Code>
                        </div>
                    </Tabs>
                </div>
                <div className="box__item">
                    <Tabs>
                        <div title="View">
                            <Input 
                                type="email"
                                label={'Email address'}
                                validation={[
                                    {
                                        type: 'required',
                                        message: 'Field is required'
                                    },{
                                        type: 'email',
                                        message: 'Incorrect format'
                                    }
                                ]}
                            />
                        </div>
                        <div title="Code">
                            <Code>
                                {`<Input 
    type="email"
    label={'Email address'}
    validation={[
        {
            type: 'required',
            message: 'Field is required'
        },{
            type: 'email',
            message: 'Incorrect format'
        }
    ]}
/>`}
                            </Code>
                        </div>
                    </Tabs>
                </div>

                <div className="box__item">
                    <Tabs>
                        <div title="View">
                            <Input 
                                type="password"
                                label={'Password'}
                                validation={[
                                    {
                                        type: 'password',
                                        length: 6,
                                        message: 'Password must include at least 6 characters',
                                    }
                                ]}
                            />
                        </div>
                        <div title="Code">
                            <Code>
                                {`<Input 
    type="text"
    label={'Name input'}
/>`}
                            </Code>
                        </div>
                    </Tabs>
                </div>

                <div className="box__item">
                    <Tabs>
                        <div title="View">
                            <Input 
                                type="text"
                                label={'Address'}
                                validation={[
{                                       type: 'custom',
                                        message: `Incorrect format`,
                                        callback: (value) => {
                                            return value.match('http://');
                                        }
                                    }
                                ]}
                            />
                        </div>
                        <div title="Code">
                            <Code>
                                {`<Input 
    type="text"
    label={'Name input'}
/>`}
                            </Code>
                        </div>
                    </Tabs>
                </div>

                <div className="box__item">
                    <Tabs>
                        <div title="View">
                            <Input 
                                type="text"
                                label={'Loading...'}
                                isLoading={true}
                            />
                        </div>
                        <div title="Code">
                            <Code>
                                {`<Input 
    type="text"
    label={'Name input'}
/>`}
                            </Code>
                        </div>
                    </Tabs>
                </div>
            </div>
        </div>
    )
}
